  }

  function handleSubmit(event) {
    event.preventDefault()
    console.log("fin cmd:", event.target.value)
  }

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <label>cmd:     </label>
        <input 
          type="text"
          placeholder="type sth"
          onChange={handleChange}
          name="cmd"
          value={cmd}
        />
        <button>Submit</button>
      </form>
      <label>output: </label>
    </div>


  );
}

